import React, { useEffect } from 'react';
import { Container, Row, Col, Breadcrumb } from 'react-bootstrap';

const Footer = () => {
	useEffect(() => {
		document.documentElement.setAttribute('data-footer', 'true');
		return () => {
			document.documentElement.removeAttribute('data-footer');
		};
	}, []);

	return (
		<footer>
			<div className="footer-content">
				<Container>
					<Row>
						<Col xs="12" sm="6">
							<p className="mb-0 text-muted text-medium">Vawlog Transportes 2023</p>
						</Col>
						<Col sm="6" className="d-none d-sm-block">
							<Breadcrumb className="pt-0 pe-0 mb-0 float-end">
								<Breadcrumb.Item className="mb-0 text-medium" href="#/" linkProps={{ className: 'btn-link' }}>
									Políticas de uso
								</Breadcrumb.Item>
								<Breadcrumb.Item className="mb-0 text-medium" href="#/" linkProps={{ className: 'btn-link' }}>
									Políticas de Privacidade
								</Breadcrumb.Item>
								<Breadcrumb.Item className="mb-0 text-medium" href="#/" linkProps={{ className: 'btn-link' }}>
									Regulamento
								</Breadcrumb.Item>
							</Breadcrumb>
						</Col>
					</Row>
				</Container>
			</div>
		</footer>
	);
};

export default React.memo(Footer);
